b = [1, 3];
c = [x, y];

% Calculate the angle between vectors a and b
thetaab = acos (dot(a, b) / (norm(a) * norm(b)));

% Calculate the angle between vectors b and c
thetabc = acos (dot(b, c) / (norm(b) * norm(c)));

% Since b bisects the angle between a and c, we have:
% thetaab = thetabc

% Also, since a, b, and c are collinear, we can express c as a scalar multiple of a
% c = k * a

% Substitute c = k * a into the angle equation
thetaab = thetabc;
thetaab = acos (dot(a, b) / (norm(a) * norm(b)));
thetabc = acos (dot(b, (k * a)) / (norm(b) * norm(k * a)));

% Solve for k
k = solve(thetaab, thetabc);

% Calculate c using the value of k
c = k * a;

% Print the result
printf('%.15g\n', c);

