The Lagrangian function is given by:
\[ \mathcal{L}(a, b, c, \lambda) = a^2 + 2b^2 + c^2 - \lambda(a + b + c - 1) \]

To find the minimum value of $f(a, b, c)$ subject to the constraint $g(a, b, c) = 0$, we need to solve the system of equations given by:
\[ \nabla \mathcal{L} = 0 \]
where $\nabla \mathcal{L}$ is the gradient of $\mathcal{L}$ with respect to $a$, $b$, $c$, and $\lambda$.

The gradient is:
\[ \nabla \mathcal{L} = \begin{bmatrix} 2a - \lambda \\ 4b - \lambda \\ 2c - \lambda \\ -(a + b + c - 1) \end{bmatrix} = 0 \]

This gives us the following system of equations:
1. $2a - \lambda = 0$
2. $4b - \lambda = 0$
3. $2c - \lambda = 0$
4. $a + b + c - 1 = 0$

We can solve this system of equations to find the values of $a$, $b$, $c$, and $\lambda$ that minimize $f(a, b, c)$ subject to the constraint $g(a, b, c) = 0$.

Here is the GNU Octave script to solve the system of equations:

