function can_be_sum_of_squares = can_be_sum_of_squares(n, squares)
    can_be_sum_of_squares = false;
    for i = 1:length(squares)
        for j = i+1:length(squares)
            if squares(i) + squares(j) == n
                can_be_sum_of_squares = true;
                break;
            end
        end
        if can_be_sum_of_squares
            break;
        end
    end
endfunction

