# Define the side length of the octagon
side_length = 2;

# Calculate the area of the regular octagon
area_octagon = 2 * (1 + sqrt(2)) * side_length^2;

# Calculate the area of the shaded region
# The shaded region is a quadrilateral formed by the intersection of four diagonals
# of the octagon. We can use the coordinates of the vertices of the quadrilateral
# to calculate its area using the Shoelace formula
# First, we need to find the coordinates of the vertices of the quadrilateral
# The vertices of the octagon are located at the following angles:
# 0, 45, 90, 135, 180, 225, 270, 315 degrees
# The coordinates of the vertices can be calculated using the following formula:
# x = r * cos(theta), y = r * sin(theta)
# where r is the radius of the circumscribed circle of the octagon
# and theta is the angle in radians
# The radius of the circumscribed circle of a regular octagon with side length s
# is given by the formula: r = s / (2 * sin pi/8)
# Calculate the radius of the circumscribed circle
radius = side_length / (2 * sin pi/8);

# Calculate the coordinates of the vertices of the octagon
vertices = [radius * cos(0), radius * sin(0);
            radius * cos pi/4, radius * sin pi/4;
            radius * cos pi/2, radius * sin pi/2;
            radius * cos 3pi/4, radius * sin 3pi/4;
            radius * cos pi, radius * sin pi;
            radius * cos 5pi/4, radius * sin 5pi/4;
            radius * cos 3pi/2, radius * sin 3pi/2;
            radius * cos 7pi/4, radius * sin 7pi/4];

# Find the coordinates of the vertices of the quadrilateral
# The vertices of the quadrilateral are the intersection points of the diagonals
# We can use the following formula to find the intersection point of two lines:
# x = (b1 * c2 - b2 * c1) / (a1 * b2 - a2 * b1)
# y = (a1 * c2 - a2 * c1) / (a1 * b2 - a2 * b1)
# where (a1, b1) and (c1, d1) are the coordinates of the endpoints of the first line
# and (a2, b2) and (c2, d2) are the coordinates of the endpoints of the second line
# The endpoints of the diagonals are the vertices of the octagon
# We can use the Shoelace formula to find the area of the quadrilateral
# The Shoelace formula is given by:
# area = 0.5 * |x1y2 + x2y3 + x3y4 + x4y1 - (y1x2 + y2x3 + y3x4 + y4x1)|
# where (x1, y1), (x2, y2), (x3, y3), and (x4, y4) are the coordinates of the vertices of the quadrilateral
# Calculate the area of the quadrilateral
area_quadrilateral = 0.5 * abs(sum (vertices([1:4, 1], [1:4, 1])) - sum (vertices([1:4, 1], [2:5, 2])));

# Calculate the area of the shaded region
area_shaded = area_octagon - area_quadrilateral;

# Print the area of the shaded region
printf('%.15g\n', area_shaded);

