# Possible outcomes for the first and second numbers on the wheel
first_numbers = [1, 2, 6, 9];
second_numbers = [1, 2, 3, 7];

# Calculate the remainders when the first and second numbers are divided by 4 and 5, respectively
first remainders = mod(first_numbers, 4);
second remainders = mod(second_numbers, 5);

# Determine the number of shaded squares on the checkerboard
shaded_squares = 2; # There are 2 shaded squares in each row and column

# Calculate the total number of possible outcomes
total_outcomes = length(first_numbers) * length(second_numbers);

# Calculate the number of favorable outcomes (landing on a shaded square)
# We need to check each combination of remainders and count the number of shaded squares
favorable_outcomes = 0;
for i = 1:4
    for j = 1:5
        if (ismember(i, first remainders) && ismember(j, second remainders) && ...
            (ismember(i, [1, 3]) && ismember(j, [1, 3])) || ...
            (ismember(i, [2, 4]) && ismember(j, [2, 4])))
            favorable_outcomes = favorable_outcomes + shaded_squares;
        end
    end
end

# Calculate the probability of landing on a shaded square
probability = favorable_outcomes / total_outcomes;

printf('%.15g\n', probability);

